import React from 'react';

function LandingPage() {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Hola, soy Samuel</h1>
      <p>Bienvenido a mi portafolio web profesional.</p>
    </div>
  );
}

export default LandingPage;
